import React from 'react';

function AddStudent(){
    return (
        <form className="add-student-container">
          <input id="studant-name" placeholder="Add your name, more than 2 character" type="text"/>
          <input id="student-age" placeholder="Add your Age 18+" type="number"/>
          <select id="student-progress">
            <option>Wery good</option>
            <option>Good</option>
            <option>Normal</option>
            <option>Bad</option>
          </select>
          <input id="add-new-student" type="submit" value="Submit"/>
       </form>
    )
}

export default AddStudent;
